import styled from 'styled-components';

export const AboutContanier = styled.div`
    display: flex;
    width: 100%;
    max-width: 1300px;
    margin: 0 auto;
    padding: 0 50px;
`
export const AboutWrapper = styled.div`
    padding: 3rem 0;
`
export const AboutHeading = styled.h1`
    font-family: ''
`
